import React, { useState, useEffect } from 'react';
import api from '../../services/api';
import FormInput from '../shared/forms/FormInput';
import Select from '../shared/forms/Select';
import Button from '../shared/buttons/Button';
import { formatDate } from '../../utils/dateUtils';

const SalaryReport = () => {
    const [report, setReport] = useState(null);
    const [loading, setLoading] = useState(false);
    const [drivers, setDrivers] = useState([]);
    const [filters, setFilters] = useState({
        year: new Date().getFullYear(),
        month: new Date().getMonth() + 1,
        driverId: '',
        includeInactive: false,
        status: 'all' // 'all', 'active', 'inactive'
    });

    useEffect(() => {
        loadDrivers();
    }, []);

    const loadDrivers = async () => {
        try {
            const response = await api.get('/drivers', {
                params: { includeInactive: true }
            });
            setDrivers(response.data);
        } catch (error) {
            console.error('Error loading drivers:', error);
        }
    };

    const generateReport = async () => {
        try {
            setLoading(true);
            const response = await api.get('/reports/salaries', { params: filters });
            setReport(response.data);
        } catch (error) {
            console.error('Error generating report:', error);
        } finally {
            setLoading(false);
        }
    };

    const calculateTotals = () => {
        if (!report?.entries.length) return {
            salariuBaza: 0,
            diurna: 0,
            bonusuri: 0,
            deduceri: 0,
            total: 0
        };

        return report.entries.reduce((acc, entry) => ({
            salariuBaza: acc.salariuBaza + entry.salariuBaza,
            diurna: acc.diurna + entry.diurna,
            bonusuri: acc.bonusuri + entry.totalBonusuri,
            deduceri: acc.deduceri + entry.totalDeduceri,
            total: acc.total + entry.total
        }), {
            salariuBaza: 0,
            diurna: 0,
            bonusuri: 0,
            deduceri: 0,
            total: 0
        });
    };

    return (
        <div className="space-y-6">
            <div className="bg-white p-4 rounded-lg shadow">
                <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
                    <Select
                        label="Luna"
                        value={filters.month}
                        onChange={e => setFilters({...filters, month: parseInt(e.target.value)})}
                        options={[
                            { value: 1, label: 'Ianuarie' },
                            { value: 2, label: 'Februarie' },
                            { value: 3, label: 'Martie' },
                            { value: 4, label: 'Aprilie' },
                            { value: 5, label: 'Mai' },
                            { value: 6, label: 'Iunie' },
                            { value: 7, label: 'Iulie' },
                            { value: 8, label: 'August' },
                            { value: 9, label: 'Septembrie' },
                            { value: 10, label: 'Octombrie' },
                            { value: 11, label: 'Noiembrie' },
                            { value: 12, label: 'Decembrie' }
                        ]}
                    />
                    <FormInput
                        type="number"
                        label="An"
                        value={filters.year}
                        onChange={e => setFilters({...filters, year: parseInt(e.target.value)})}
                        min={2000}
                        max={2100}
                    />
                    <Select
                        label="Șofer"
                        value={filters.driverId}
                        onChange={e => setFilters({...filters, driverId: e.target.value})}
                    >
                        <option value="">Toți șoferii</option>
                        {drivers.map(driver => (
                            <option key={driver._id} value={driver._id}>
                                {driver.nume} {!driver.activ && '(Inactiv)'}
                            </option>
                        ))}
                    </Select>
                    <Select
                        label="Status"
                        value={filters.status}
                        onChange={e => setFilters({...filters, status: e.target.value})}
                    >
                        <option value="all">Toți șoferii</option>
                        <option value="active">Doar activi</option>
                        <option value="inactive">Doar inactivi</option>
                    </Select>
                </div>
                <div className="mt-4">
                    <Button 
                        onClick={generateReport} 
                        disabled={loading}
                        variant="primary"
                    >
                        {loading ? 'Se generează...' : 'Generează Raport'}
                    </Button>
                </div>
            </div>

            {report && (
                <div className="bg-white p-6 rounded-lg shadow">
                    <div className="flex justify-between items-center mb-4">
                        <h3 className="text-lg font-medium">Raport Salarii</h3>
                        <div className="text-sm text-gray-500">
                            {filters.month}/{filters.year}
                        </div>
                    </div>

                    <div className="overflow-x-auto">
                        <table className="min-w-full divide-y divide-gray-200">
                            <thead>
                                <tr>
                                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">
                                        Șofer
                                    </th>
                                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">
                                        Status
                                    </th>
                                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">
                                        Salariu Bază
                                    </th>
                                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">
                                        Diurnă (EUR)
                                    </th>
                                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">
                                        Bonusuri
                                    </th>
                                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">
                                        Deduceri
                                    </th>
                                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">
                                        Total RON
                                    </th>
                                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">
                                        Total EUR
                                    </th>
                                </tr>
                            </thead>
                            <tbody className="divide-y divide-gray-200">
                                {report.entries.map((entry, index) => (
                                    <tr key={index} className={!entry.activ ? 'bg-gray-50' : ''}>
                                        <td className="px-6 py-4 whitespace-nowrap">
                                            {entry.sofer.nume}
                                        </td>
                                        <td className="px-6 py-4 whitespace-nowrap">
                                            <span className={`px-2 py-1 rounded-full text-xs ${
                                                entry.activ ? 
                                                'bg-green-100 text-green-800' : 
                                                'bg-gray-100 text-gray-800'
                                            }`}>
                                                {entry.activ ? 'Activ' : 'Inactiv'}
                                            </span>
                                        </td>
                                        <td className="px-6 py-4 whitespace-nowrap">
                                            {entry.salariuBaza} RON
                                        </td>
                                        <td className="px-6 py-4 whitespace-nowrap">
                                            {entry.diurna}
                                        </td>
                                        <td className="px-6 py-4 whitespace-nowrap text-green-600">
                                            +{entry.totalBonusuri} RON
                                        </td>
                                        <td className="px-6 py-4 whitespace-nowrap text-red-600">
                                            -{entry.totalDeduceri} RON
                                        </td>
                                        <td className="px-6 py-4 whitespace-nowrap font-medium">
                                            {entry.total} RON
                                        </td>
                                        <td className="px-6 py-4 whitespace-nowrap font-medium">
                                            {entry.diurna} EUR
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                            <tfoot>
                                <tr className="bg-gray-50 font-medium">
                                    <td colSpan="2" className="px-6 py-4">
                                        Total
                                    </td>
                                    <td className="px-6 py-4">
                                        {calculateTotals().salariuBaza} RON
                                    </td>
                                    <td className="px-6 py-4">
                                        {calculateTotals().diurna} EUR
                                    </td>
                                    <td className="px-6 py-4 text-green-600">
                                        +{calculateTotals().bonusuri} RON
                                    </td>
                                    <td className="px-6 py-4 text-red-600">
                                        -{calculateTotals().deduceri} RON
                                    </td>
                                    <td className="px-6 py-4">
                                        {calculateTotals().total} RON
                                    </td>
                                    <td className="px-6 py-4">
                                        {calculateTotals().diurna} EUR
                                    </td>
                                </tr>
                            </tfoot>
                        </table>
                    </div>
                </div>
            )}
        </div>
    );
};

export default SalaryReport;
